import React from 'react'

const Home = () => {
    return (
        <>
          <div className='main_video'>
             <video>
               <source src='https://youtu.be/2T1lpNK6Nvk' type='video/mp4'/>
             </video>
          </div>  
        </>
    )
}

export default Home
